        <p>&copy; {new Date().getFullYear()} BlockFest. The Future of Event Ticketing.</p>
        <p className="mt-1">Built with ❤️ by Pranay, Saloni & Sidharth</p>
         {/* Add social links or other info if needed */}
      </div>
    </footer>
  );
};

export default Footer;
